import React from 'react';

const Cards = {
    borderRadius: "24px",
    padding: "12px",
    margin: "12px",
}

const CardStyle = {
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
}

const imageStyle = {
    height: "50vh",
    borderRadius: "24px",
    margin: "8px",
}

export default function ProjectCard({ images, title }) {
    return (

        <div style={Cards}>
            <h2>{title}</h2>
            <a href="https://jeb.biologists.org/content/221/12/jeb179598">
                <div className={CardStyle}>
                    {images.map((value) => <img style={imageStyle} src={value} alt="Photos of projects" />)}
                </div>
            </a>
        </div>
    )
}
